import { Container, Typography } from "@mui/material";
import React from "react";

function Patners() {
  return (
    <Container
      sx={{
        width: "100%",
        height: "280px",
        backgroundColor: "#d6e7fa",
        marginTop: 15,
        borderRadius: "70px",
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          padding: 6,
          textAlign:'center',
          fontSize: "2.3rem",
          fontWeight: "700",
          color: "black",
          lineHeight: 1.2,
          position: "relative", // Required for ::after to work
          display: "inline-block", // Ensures width is correct
          "&::after": {
            content: '""',
            position: "absolute",
            right: 2,
            borderRadius: "5px",
            bottom: "-5px", // Adjust the underline position
            width: "162px", // Width of the underline
            height: "4px", // Thickness of the underline
            backgroundColor: "#3593b0", // Underline color
          },
        }}
      >
        Our Partners
      </Typography>
    </Container>
  );
}

export default Patners;
